    function refreshPopOver()
    {
        var diagramData = window.svgpublish.shapes;

        $.each(diagramData, function (shapeId, shapeData) {

            var props = shapeData.Props;
            //var props = Datajsonformat.;
            if (!props)
                return;

            //Get Object matching the usecase 
            function getValue(useCaseID) {
                var val=[];
                $.each(dataUseCase, function (i,e) {
                    if (e["Use Case ID"].indexOf(useCaseID) >= 0) {
                        val = e;
                        return false;
                    }
                });
                return val;
            };

            var useCaseActivity = getValue(props["Use Case ID"]);
            //Split Steps 
            var steps ="";
            if (typeof useCaseActivity["Steps"] !== "undefined") {
                steps = useCaseActivity["Steps"].replace(/\n/g, '<br />');
            }

            var $shape = $("#" + shapeId);

            // build options for popover: placement function, iframe url from properties
            var options = {
                placement: function (context, source) {
                    var position = $(source).position();
                    if (position.right > 500)
                        return "left";
                    if (position.left < 500)
                        return "right";
                    if (position.top < 300)
                        return "bottom";
                    return "top";
                },
                trigger: "manual",
                container: "html",
                html: true,
                content: '' +
                    '<p>' +
                      '<span class="h4"> ' + props["Activity Name"] + '<br/>' +
                      '<span class="text-muted small"> ' + props["Use Case ID"] + '</span>' +
                    '</p>' +
                    '<p><b>Actor:</b> ' + useCaseActivity["Actor"] + '</p>' +
                    '<p><b>Location:</b> ' + useCaseActivity["Location"] + '</p>' +
                    '<p><b>Description:</b> '+ useCaseActivity["Description"] + '</p>' +
                    '<p><b>Steps:</b> </p>' +
                    '<p>' + steps + '</p>' +
                    '<p><b>Application:</b> ' + useCaseActivity["Application"] + '</p>' +
                    '<p><b>Notes:</b> ' + useCaseActivity["Activity Notes"] + '</p>' +
                    '<p><b>Documents:</b> ' + useCaseActivity["Related Documents"] + '</p>',
                title: props["Activity Name"]
            };

            // create the popover for the shape        
            $shape.popover(options);

            // decorate the shape with "hand" cursor
            $shape.css("cursor", "pointer");

            // hide the popover hiding when clicked outside
            $('body').on('click', function (e) {
                $shape.popover('hide');
            });

            $shape.on('click', function (evt) {
                evt.stopPropagation();
                $shape.popover('toggle');
            });

            $shape.on('mouseover', function () {
                $(this).attr('filter', 'url(#hover)');
            });

            $shape.on('mouseout', function () {
                $(this).removeAttr('filter');
            });

            $shape.tooltip({
                container: "body",
                title: props.Name
            });
        });
    }
    //Read XLSX
    var oFileIn;

    $(function()
    {
        oFileIn = document.getElementById('my_file_input');
        if(oFileIn.addEventListener)
        {
            oFileIn.addEventListener('change', filePicked, false);
        }

    function filePicked(oEvent) 
    {
        // Get The File From The Input
        files = [];
        var oFile = oEvent.target.files[0];
        var sFilename = oFile.name;
        // Create A File Reader HTML5
        var reader = new FileReader();


        // Ready The Event For When A File Gets Selected
        reader.onload = function(e) 
        {
            var data = e.target.result;
            var workbook = XLSX.read(data, {type : 'binary'});

            /* DO SOMETHING WITH workbook HERE */
            var first_sheet_name = workbook.SheetNames[2];
            /* Get worksheet */
            var worksheet = workbook.Sheets[first_sheet_name];

            var Datajsonformat = XLSX.utils.sheet_to_json(worksheet);
            dataUseCase = Datajsonformat;
            console.log(Datajsonformat);
            refreshPopOver();
        }
        reader.readAsBinaryString(oFile);
    }
